import { makeAutoObservable } from "mobx";


class testState {
    count = 0;

    get multipliedCount() {
        return this.count * 2;
    }

    constructor() {
        makeAutoObservable(this)
    }

    increment() {
        this.count += 1;
    }
    decrement() {
        this.count -= 1;
    }


}


export default new testState()
